window.bookSummaryJSON = "<p>Beware the wrath of a broken blind girl.</p> <p>Victor. Torsten. Cassius – the jock, the artist, the stepbrother.</p> <p>They made me theirs – body, heart, and soul.</p> <p>They got inside my head.</p> <p>They broke down my defenses and made me trust them</p> <p>… maybe even love them.</p> <p>They betrayed me.</p> <p>They think they’re untouchable,</p> <p>but they forget that I’m one of them.</p> <p>I’m the poison flower in their garden,</p> <p>beautiful and deadly,</p> <p>hiding in plain sight.</p> <p>I know all their secrets,</p> <p>Their weaknesses,</p> <p>Their darkest desires,</p> <p>And I’m going to make them pay.</p> <p>Poison Kiss is a new adult, dark contemporary romance with three hot, dangerous guys and the blind girl who rules them. It is intended for 18+ listeners.</p>"; 
